In quadrilateral $ABCD$, angle $BAD$ and angle $CDA$ are trisected as shown. What is the degree measure of angle $AFD$?

[asy]
size(150);
pair A , B, C, D; A = (0,0); B = (2, 4); C = (7,4); D = (7, -2);
draw( (0,0)--(2,4) -- (7,4) -- (7, -2)-- cycle);
label("$A$", A, SW);
label("$B$", B, NW);
label("$C$", C, NE);
label("$D$", D, SE);
pair E, F;
E = (4.5-.2,1-.2); F = (5, 3);
draw(A--E--D); draw(A--F--D);
label("$E$", E, N); label("$F$", F, NW);
dot(A);dot(B);dot(C);dot(D);dot(E);dot(F);
label("$x$", (1, 1.5), S); label("$x$", (2, 1), S+W); label("$x$", (2, -1), N+N+N+W);
label("$y$", (5.5+.3, .5-.3), S); label("$y$", (6.5+.3, 0)); label("$y$", (5+.5, -1.5+.3));
label("$110^{\circ}$",(2.5,3.5)); label("$100^{\circ}$",(6.5-.2,3.5));
[/asy]

A hexagon is inscribed in a circle: [asy]
pair pA, pB, pC, pD, pE, pF, pO;
pO = (0, 0);
pA = pO + dir(-10);
pB = pO + dir(60);
pC = pO + dir(130);
pD = pO + dir(170);
pE = pO + dir(-160);
pF = pO + dir(-80);
draw(pA--pB--pC--pD--pE--pF--pA);
label("$105^\circ$", pF, N * 2);
label("$110^\circ$", pB, SW * 1.5);
label("$\alpha$", pD, E);
draw(circle(pO, 1));
[/asy] What is the measure of $\alpha$, in degrees?

In the diagram, $D$ and $E$ are the midpoints of $\overline{AB}$ and $\overline{BC}$ respectively.  Determine the area of quadrilateral $DBEF$. [asy]
size(180); defaultpen(linewidth(.7pt)+fontsize(10pt));
pair A, B, C, D, E, F;
A=(0,6);
B=(0,0);
C=(8,0);
D=(0,3);
E=(4,0);
F=(8/3,2);
draw(E--A--C--D);
draw((-1,0)--(10,0), EndArrow);
draw((0,-1)--(0,8), EndArrow);
label("$A(0,6)$", A, W);
label("$B(0,0)$", B, SW);
label("$C(8,0)$", C, S);
label("$D$", D, W);
label("$E$", E, S);
label("$F$", F, SW);
label("$x$", (10,0), dir(0));
label("$y$", (0,8), dir(90));
[/asy]
